(t: ((org.apache.wayang.basic.data.Record, String), String)) => {
        val rec = t._1._1;
        val id = rec.getField(0).toString;
        val orgNo = rec.getField(1).toString;
        val active = rec.getField(2).toString;
        val name = rec.getField(3).toString;
        val soc = rec.getField(4).toString;
        val muni = rec.getField(5).toString;
        s"${id},${orgNo},${active},${name},${soc},${muni}"
      }

